        DB::table("answers_options")->insert([ "id" => "424", "name" => "No, consideras que tu opinión sea buena y que la de los demás no tenga por qué serlo siempre.", "question_id" => " 207", ]);
        DB::table("answers_options")->insert([ "id" => "425", "name" => "Si, pero sólo ante las decisiones que consideras demasiado importantes como para actuar precipitadamente. ", "question_id" => " 207", ]);
        DB::table("answers_options")->insert([ "id" => "426", "name" => "Si, siempre que puedes consultas con los demás. Te equivocas con frecuencia y quieres hacer las cosas bien.", "question_id" => " 207", ]);
        DB::table("answers_options")->insert([ "id" => "427", "name" => "Depende de la decisión. Sueles tener claro lo que vas a hacer, pero consideras las posibilidades que te ofrecen los demas.", "question_id" => " 207", ]);
        DB::table("answers_options")->insert([ "id" => "428", "name" => "No le das importancia, te comportas con naturalidad y si alguien te lo comenta haces alguna broma al respecto.", "question_id" => " 208", ]);
        DB::table("answers_options")->insert([ "id" => "429", "name" => "Te da mucha vergüenza. Procuras situarte en algún lugar discreto y pasar desapercibido. ", "question_id" => " 208", ]);
        DB::table("answers_options")->insert([ "id" => "430", "name" => "Te sientes incómodo pero tratas de no pensar en ello, te enteras en la reunión y das alguna excusa por tu error.", "question_id" => " 208", ]);
        DB::table("answers_options")->insert([ "id" => "431", "name" => "No te importa nada en absoluto, aunque no lleves la ropa adecuada tienes estil y sabes llevar bien cualquier cosa.", "question_id" => " 208", ]);
        DB::table("answers_options")->insert([ "id" => "432", "name" => "Admiras el estilo de tu acompañante, al final compras un par de prendas necesarias por muy simples en cuanto a forma y color.", "question_id" => " 209", ]);
        DB::table("answers_options")->insert([ "id" => "433", "name" => "No estás dispuesto a que te gane, decides comprar varias prendas muy modernas y bastante caras.", "question_id" => " 209", ]);
        DB::table("answers_options")->insert([ "id" => "434", "name" => "Asmiras su estilo pero eres muy consciente del tuyo, compras la ropa que mejor te sienta y que necesitas, y pasan un rato ameno probándolos cosas diferentes. ", "question_id" => " 209", ]);
        DB::table("answers_options")->insert([ "id" => "435", "name" => "A su lado te sientes bastante poca cosa, te quita las ganas de probarte nada y mucho menos de comprar. Pones una excusa y te marchas.", "question_id" => " 209", ]);
        DB::table("answers_options")->insert([ "id" => "436", "name" => "No crees que tengas mucho que contar, tu trabajo es muy corriente, tus amigos son normales y tus aficiones también. Prefieres que esta persona te cuente su vida.", "question_id" => " 210", ]);
        DB::table("answers_options")->insert([ "id" => "437", "name" => "Tu trabajo te gusta y aunque sea corriente, siempre lo enfocas desde una perspectiva interesante, tus aficiones son tu pasión y disfrutas hablando de ellas, tambien hablas de tus proyectos futuros. ", "question_id" => " 210", ]);
        DB::table("answers_options")->insert([ "id" => "438", "name" => "Hablasen lineas generales de tu tabajo y de tus aficiones, sobre todo hablas de tus amigos y de lo más interesante de sus vidas", "question_id" => " 210", ]);
        DB::table("answers_options")->insert([ "id" => "439", "name" => "Más que tu trabajo actual, hablas de tus proyectos y de tus objetivos, y de lo que vas a hacer para logrados, de lo buenas que son tus amistades y lo poco usual de tus aficiones. Te gusta hablar de ti.", "question_id" => " 210", ]);
        DB::table("answers_options")->insert([ "id" => "440", "name" => "Paras la explicación y requieres que se empiece de nuevo, si tu no lo entiendes habrá muchas gente que tampoco lo haga.", "question_id" => " 211", ]);
        DB::table("answers_options")->insert([ "id" => "441", "name" => "Si hay más gente que pregunte tú también lo haces, si no, buscas en un aparte al ponente para que te aclare las dudas.", "question_id" => " 211", ]);
        DB::table("answers_options")->insert([ "id" => "442", "name" => "Te da mucha vergüenza preguntar y demostrar así que no entiendes. Más tarde preguntarás a algún amigo o intentarás informante por tu cuenta.", "question_id" => " 211", ]);
        DB::table("answers_options")->insert([ "id" => "443", "name" => "Tomas nota de lo que no entiendes para preguntarlo al finalizar la charla, si sigues con dudas perdirás información complementaria para prepararte mejor.", "question_id" => " 211", ]);
        DB::table("answers_options")->insert([ "id" => "444", "name" => "Satisfactoria, tratas de buscar el lado positivo de las cosas y nunca te faltan proyectos y objetivos que perseguir.", "question_id" => " 212", ]);
        DB::table("answers_options")->insert([ "id" => "445", "name" => "Horrible, no obstante, sabes que las cosas están mal y que tienes que aguantar lo que sea. Estás muy agradecido por tener trabajo.", "question_id" => " 212", ]);
        DB::table("answers_options")->insert([ "id" => "446", "name" => "No te prpeocupa especialmente el tema, tienes un montón de proyectos más importantes y con tu valía los alcanzarás.", "question_id" => " 212", ]);
        DB::table("answers_options")->insert([ "id" => "447", "name" => "Has logrado que no te afecte, consideras más importante tu vida personal y privada y eso es por lo que luchas.", "question_id" => " 212", ]);
        DB::table("answers_options")->insert([ "id" => "448", "name" => "Prefieres no pensarlo, el dia ha sido duro pero para ti no es algo nuevo, solo pides poder dormir bien y que mañana sea un día más tranquilo.", "question_id" => " 213", ]);
        DB::table("answers_options")->insert([ "id" => "449", "name" => "Se lo cuentas a todo el mundo, te gusta que se te reconozca cuando haces las cosas bien y exiges en cada que te mimen por haberte esforzado tanto.", "question_id" => " 213", ]);
        DB::table("answers_options")->insert([ "id" => "450", "name" => "Esás muy satisgecho y decides darte un capricho, darte un baño de espuma y ver una buena película, o comparte un regalito que hace tiempo querías.", "question_id" => " 213", ]);
        DB::table("answers_options")->insert([ "id" => "451", "name" => "Te preocupa que se te haya olvidado algo o haber hecho algo mal por la prisa, repasas mentalmente las actividades y al día siguiente esperas no tener queja de nadie.", "question_id" => " 213", ]);
        DB::table("answers_options")->insert([ "id" => "452", "name" => "No te planteas ser voluntario, hay mil personas más capacitadas que tú para la demostración y no se te da bien hablaren público.", "question_id" => " 214", ]);
        DB::table("answers_options")->insert([ "id" => "453", "name" => "Te presentas voluntario, puede ser una experiencia interesante y si sales elegido puedes hacer una presentación innovadora.", "question_id" => " 214", ]);
        DB::table("answers_options")->insert([ "id" => "454", "name" => "No te presentas, serías capaz de hacerla bien pero crees que hay gente mejor preparada y más original que tú.", "question_id" => " 214", ]);
        DB::table("answers_options")->insert([ "id" => "455", "name" => "Te presentas y estás casi seguro de que te elegirán, haces buenos proyectos y darás una buena imagen de la empresa.", "question_id" => " 214", ]);
        DB::table("answers_options")->insert([ "id" => "456", "name" => "La buena suerte puede tocarle a todo el mundo, yo me considero una persona afortunada a la que la vida le sonríe.", "question_id" => " 215", ]);
        DB::table("answers_options")->insert([ "id" => "457", "name" => "Para tener buena suerte hay que trabajar duro, sólo los muy afortunados la tienen sin apenas esfuerzo.", "question_id" => " 215", ]);
        DB::table("answers_options")->insert([ "id" => "458", "name" => "Yo no tengo suerte, tanto los premios como las cosas especia les sólo les pasan a los demás.", "question_id" => " 215", ]);
        DB::table("answers_options")->insert([ "id" => "459", "name" => "La suerte respecto a los premios es una cuestión de probabilidad, y respecto a las cosas de la vida, siempre depende de cómo se perciban.", "question_id" => " 215", ]);
        DB::table("answers_options")->insert([ "id" => "460", "name" => "Te interesa conocerlos no sólo para pasar un buen rato en la reunión sino porque puede ser una forma de iniciar una amistad. ", "question_id" => " 216", ]);
        DB::table("answers_options")->insert([ "id" => "461", "name" => "Esperas causarles una buena impresión y decir cosas que les puedan interesar. ", "question_id" => " 216", ]);
        DB::table("answers_options")->insert([ "id" => "462", "name" => "Te gustaría llevarles a tu terreno en la conversación para así poder hablar de los temas que más te interesan.", "question_id" => " 216", ]);
        DB::table("answers_options")->insert([ "id" => "463", "name" => "Antes de iniciar una conversación escuchas lo que dicen, y es peras para hablar a que lo hagan de temas que tú conozcas.", "question_id" => " 216", ]);        
